export default function Form() {
  return (
    <div>
      <h1> Welcome Back !!</h1>
      <p> Welcome back... Please enter your details</p>
      <div>
        <div>
          <label>Email:</label>
          <input className="" placeholder="Enter your email" />
        </div>
      </div>
    </div>
  );
}
